"use strict";var products=document.querySelector(".shop__list");function getGods(){return[{root:"./image/coffee1.webp",title:"Шоколадное кофе",price:57},{root:"./image/coffee2.webp",title:"Ванильное кофе",price:39},{root:"./image/coffee3.webp",title:"Черное кофе",price:32}]}var render={goodsItem:function(t,o,e){return'  \n    <div class="shop__product product">\n        <img class="product__img" src="'.concat(t,'" alt="Черное">\n        <div class="product__groop">\n            <p class="product-description">').concat(o,'</p>  \n            <span class="product__price">').concat(e,' Р</span> \n            <button class="product__btn btn">Заказать</button>\n        </div>\n    </div>')},goodsList:function(t){var o=this,e=t.map(function(t){return o.goodsItem(t.root,t.title,t.price)}).join("");products.innerHTML=e}};render.goodsList(getGods());